function onStart()    print("Load Image2D")    img = Image2D.create(10, 10, "../assets/images/logo_small.png")    img:updatePosition(300, 300)    brakeza:addObject3D(img, 'myImage2D')    print("Load Image2DAnimation")    animation2d = Image2DAnimation.create(100, 100, "../assets/sprites/explosion_a.png", 128, 128, 15, 24)    brakeza:addObject3D(animation2d, 'myAnimation')    print("Load Image3D")    image3d = Image3D.create(Vertex3D.new(10, 10, 10), 10, 10, "../assets/sprites/explosion_a.png")    brakeza:addObject3D(image3d, 'myImage3D')    print("Load Mesh3D")    eye = Mesh3D.create(Vertex3D.new(0, 0, 10), "../assets/models/eye.fbx")    eye:setStencilBufferEnabled(true)    eye:setBelongToScene(false)    eye:setRotationFrameEnabled(true)    eye:setRotationFrame(Vertex3D.new(1, 0, 0))    eye:setScale(10)    brakeza:addObject3D(eye, 'myMesh')    print("Load Mesh3DAnimation")    man = Mesh3DAnimation.create(Vertex3D.new(0, -10, 40), "../assets/animations/walking.fbx")    man:setStencilBufferEnabled(true)    man:setBelongToScene(false)    man:setScale(0.01)    brakeza:addObject3D(man, 'myMeshAnimated')    print("Load BillboardAnimation")    billboard = BillboardAnimation.create(Vertex3D.new(0, 10, 80), 100, 100, "../assets/sprites/explosion_a.png", 128, 128, 15, 24)    brakeza:addObject3D(billboard, 'myBillboard')    print("Load BillboardAnimation8Directions")    billboard8d = BillboardAnimation8Directions.create(Vertex3D.new(0, 10, 80), 100, 100, "../assets/sprites/Sprites3D/soldier/fire", 2, 24)    brakeza:addObject3D(billboard8d, 'myBillboard8D')    print("Load LightPoint3D")    lp = LightPoint3D.create(Vertex3D.new(5, -10, 5))    lp:setColor(Color.new(255, 255, 0, 255))    brakeza:addObject3D(lp, 'lp')    print("Load SpotLight3D")    sl = SpotLight3D.create(Vertex3D.new(5, -10, 5), Vertex3D.new(0, 0, 1))    sl:setColor(Color.new(255, 255, 0, 255))    brakeza:addObject3D(sl, "sl")    print("Load ParticleEmitter")    particles = ParticleEmitter.create(        Vertex3D.new(10, 10, 10),        100,        Color.new(255, 255, 0, 255),        Color.new(255, 255, 255, 255),        ParticlesContext.new(            0.0,            2,            1.0,            25.0,            1,            10,            125.0,            255.0,            5,            10,            0.99        ),        "../assets/images/logo_small.png"    )    brakeza:addObject3D(particles, "emitter")    render = componentsManager:getComponentRender()    render:setGlobalIlluminationAmbient(Vertex3D.new(1, 0, 0)) -- rojoendfunction onUpdate()end